    NSShadow* darkInner = [NSShadow shadowWithColor: blackOpacity15 offset: CGSizeMake(0.1, 1.1) blurRadius: 1];

    //// Frames
    CGRect frame = CGRectMake(48, 40, 32, 48);

    //// Subframes
    CGRect frontDoorGroup = CGRectMake(CGRectGetMinX(frame) + 2, CGRectGetMinY(frame) + 2, CGRectGetWidth(frame) - 4, CGRectGetHeight(frame) - 4);


    //// Front Door Frame Group
    {
        //// Front Door Group
        {
            CGContextSaveGState(context);
            CGContextSetShadowWithColor(context, bottomShadow.shadowOffset, bottomShadow.shadowBlurRadius, [bottomShadow.shadowColor CGColor]);
            CGContextBeginTransparencyLayer(context, NULL);


            //// Door Step Drawing
